const { Given, When, Then } = require('@cucumber/cucumber');
const { chromium } = require('@playwright/test');
const LoginPage = require('../pages/LoginPage');

let browser;
let page;
let loginPage;

Given('I am on the login page', async function () {
    browser = await chromium.launch({ headless: false });
    page = await browser.newPage();
    loginPage = new LoginPage(page);
    await loginPage.navigateTo('https://www.saucedemo.com/v1/');
});

When('I enter username {string}', async function (username) {
    await loginPage.fill(loginPage.usernameInput, username);
});

When('I enter password {string}', async function (password) {
    await loginPage.fill(loginPage.passwordInput, password);
});

When('I click the login button', async function () {
    await loginPage.click(loginPage.loginButton);
});

Then('I should be logged in successfully', async function () {
    await page.waitForSelector('.inventory_list');
    await page.waitForSelector('.product_label');
});

Then('I should see an error message', async function () {
    await page.waitForSelector('[data-test="error"]');
});

After(async function () {
    if (browser) {
        await browser.close();
    }
});

